  <title>SVG Morph Animation</title>
  <style>
.districts {
  width: 800px;
  height: 800px;
}

.district01 {
  fill: #ff0000;
}

.district11 {
  fill: #00ff00;
  opacity: 0;
}

.district22 {
  fill: #0000ff;
  opacity: 0;
}

@keyframes morph {
  0% {
    opacity: 0;
  }
  25% {
    opacity: 1;
    transform: scale(0.9);
  }
  50% {
    transform: scale(1.1);
  }
  75% {
    transform: scale(0.9);
  }
  100% {
    opacity: 0;
  }
}

.districts:hover .district01 {
  animation: morph 4s infinite;
}

.districts:hover .district11 {
  animation: morph 4s infinite 1s;
  opacity: 1;
}

.districts:hover .district22 {
  animation: morph 4s infinite 2s;
  opacity: 1;
}

  </style>
